import React from "react";

class Pokemon extends React.Component {
    render() {
        return (
            <div>
                <p>Nome: {this.props.name}</p>
                <p>Tipo: {this.props.type}</p>
                <p>Peso: {this.props.weigth}</p>
                <img src={this.props.img} alt="" />
            </div>
        )
    }
}

export default Pokemon
